import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
    profile :{
        backgroundImage : 'linear-gradient(90deg , #FFE00D , #FEA127)',
        height : '700px',
        display:'flex',
        flexDirection : 'column !important'
    },
    profileSVG:{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-end',
        justifyContent: 'flex-end',
        alignContent: 'flex-end',
        height: '100%',
    },
    profilePic:{
        position:'absolute'
    },
    profilePicture:{
        display: 'flex',
        justifyContent: 'center',
        marginTop : '66px',
        zIndex : 3
    },
    profileText:{
        zIndex:99,
    }
});
export default useStyles;
